import React from 'react';
import './App.css';

export default function App() {
    return (
        <div className="App">
            <div>
                <div className="left-image">
                <img alt="" src="/gift.png" />
                </div>
                <div className="right-image">
                    <img alt="" src="/gift.png" />
                </div>
            </div>
        </div>
    )
};
